import React from "react";
import { Link } from "react-router-dom"; // Ensure Link is imported

const Navbar = ({ title = "CMS" }) => {
    return (
        <nav className="navbar navbar-expand-lg bg-primary" data-bs-theme="dark">
            <div className="container-fluid">
                <Link className="navbar-brand" to="/">{title}</Link> {/* Use Link for navigation */}
                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarColor01"
                    aria-controls="navbarColor01"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarColor01">
                    <ul className="navbar-nav ms-auto">
                        <li className="nav-item">
                            <Link className="nav-link" to="/login">Login</Link> {/* Use Link here */}
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/register">Register</Link> {/* Use Link here */}
                        </li>
                        <li className="nav-item">
                            <button className="btn btn-danger">Logout</button>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
